import * as React from "react";

import { Button, Table } from "react-bootstrap";
import { useAppState } from "../../../service/AppStateContext.tsx";
import BaseService from "../../../service/base.service.tsx";
import { Customers } from "../models/customers";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { GoBack } from "../../../defultComponent/funPublik";

const Price = (priceAll) => {
    if (priceAll.priceAll) {
        return (
            <div>
                {priceAll.priceAll + "₪"}
            </div>
        )
    }
    else {
        return (
            "------"
        )
    }
}

const Status = (queue) => {
    console.log("GroupSeqNo", queue)
    if (queue === "tobesitted") {
        return (
            "ממתין לשולחן"
        )
    }
    if (queue === "sitting") {
        return (
            "ממתין לשירות"
        )
    }
    if (queue === "awaitingbill") {
        return (
            "ממתין לחשבון"
        )
    }
}

const CustomersView = (props) => {
    const [setError] = useState(null);
    const [isLoadedsetIsLoaded] = useState(false);
    const [customer, setCustomers] = useState({}, Customers);


    const path = window.location.pathname;
    console.log("path", path)

    const { state } = useAppState();

    const MapResevation = (reservation) => {
        console.log("reservation", reservation)
        return (
            <menu className="table table-dark" >
                <thead>
                    <tr>
                        <th>id</th>
                        <th>שם מנה</th>
                        <th>קטגוריה</th>
                        <th>מחיר</th>
                    </tr>
                </thead>
                <tbody>
                    {reservation.map((item, i) => {
                        return (
                            <tr key={i} className="align-items-center">
                                <td>{item.id}</td>
                                <td>{item.name}</td>
                                <td>{item.category}</td>
                                <td>{item.price}</td>
                            </tr>
                        )
                    })}
                </tbody>
            </menu>
        )
    }

    useEffect(() => {
        console.group("ssss", state);
        BaseService.fetch(`${path}`).then(
            (response) => {
                setIsLoaded(true);
                setCustomers(response.data, Customers);
                console.log("response.data", response.data);
                console.log("customer Daqta", customer);
                console.groupEnd();
            },
            (error) => {
                setIsLoaded(true);
                setError(error);
            }
        );
    }, [state]);
    return (
        <>
            <GoBack />
            <Table className="table table-dark">
                <tbody>
                    <tr>
                        <td>שם קבוצה:</td>
                        <td>{customer.name}</td>
                    </tr>
                    <tr>
                        <td>גודל קבוצה:</td>
                        <td>{customer.size}</td>
                    </tr>
                    <tr>
                        <td>שעת הגעה:</td>
                        <td>{customer.GroupSeqNo}</td>
                    </tr>
                    <tr>
                        <td>שולחן:</td>
                        <td>{customer.table ?
                            <Link
                                to={"/tables/" + customer.table}
                                className="px-1"
                                title="view">
                                <Button variant="secondary">
                                    {customer.table}
                                </Button>
                            </Link> : "מחכים לשולחן"}
                        </td>
                    </tr>
                    <tr>
                        <td>סטטוס:</td>
                        <td>{Status(customer.queue)}</td>
                    </tr>
                    <tr>
                        <td>סך לתשלום</td>
                        <td><Price priceAll={customer.priceAll} /></td>
                    </tr>
                    <tr>
                        <td>הזמנות:</td>
                        <td>{customer.reservation ? MapResevation(customer.reservation) : "------"}</td>
                    </tr>
                </tbody>
            </Table>
        </>
    );
};
export default CustomersView;
